import { signOut } from "firebase/auth";
import { auth } from "../../firebase.js";
import { useNavigate } from "react-router-dom";

function Home() {
  const navigate = useNavigate();
  const handleSignOut = () => {
    signOut(auth)
      .then(() => {
        navigate("/home");
      })
      .catch((err) => {
        alert("not");
      });
  };
  return (
    <div>
      <h1>Home</h1>
      <button onClick={handleSignOut}>SignOut</button>
    </div>
  );
}

export default Home;
